import { Button, ListGroup } from "reactstrap";
import { Link } from "react-scroll";
const Menu = () => {
  const openNav = () => {
    document.querySelector("mySideBar").style.width = "250px";
    document.querySelector("main").style.marginLeft = "250px";
  };
  const closeNav = () => {
    document.querySelector("mySideBar").style.width = "0";
    document.querySelector("main").style.marginLeft = "0";
  };

  return (
    <div>
      <div class="sidenav sty hover">
        <li className="nav-item active">
          <Button variant="primary" onClick={openNav}>
            Open SideBar
          </Button>
          <Link
            className="nav-link"
            activeClass="active"
            to="intro"
            spy={true}
            smooth={true}
            offset={10}
            duration={50}
            // onSetActive={this.handleSetActive}
          >
            Home
          </Link>
        </li>
        <li className="nav-item">
          <Link
            className="nav-link"
            activeClass="active"
            to="projects"
            spy={true}
            smooth={true}
            offset={10}
            duration={50}
            // onSetActive={this.handleSetActive}
          >
            Projects
          </Link>
        </li>
        <li className="nav-item">
          <Link
            className="nav-link"
            activeClass="active"
            to="skills"
            spy={true}
            smooth={true}
            offset={10}
            duration={50}
            // onSetActive={this.handleSetActive}
          >
            Skills
          </Link>
        </li>
        <li className="nav-item">
          <Link
            className="nav-link"
            activeClass="active"
            to="exp"
            spy={true}
            smooth={true}
            offset={10}
            duration={50}
            // onSetActive={this.handleSetActive}
          >
            Experience
          </Link>
        </li>
        <li className="nav-item">
          <Link
            className="nav-link"
            activeClass="active"
            to="contact"
            spy={true}
            smooth={true}
            offset={10}
            duration={50}
            // onSetActive={this.handleSetActive}
          >
            Contact
          </Link>
        </li>
      </div>
    </div>
  );
};
export default Menu;
